        // }
        // navigate(`/detail/${id}`);
    }
    const goEdit = () => {
        console.log([SERVER_URL, id].join("/"));
        // navigate(`/edit/${id}`);
    }
    return (
        <div className="EvaluationItem">
            <div onClick={goDetail} className="img_section">
